import styled from 'styled-components';

export const Heading1 = styled.h1`
    font-family: 'Titillium Web',sans-serif;
    font-weight: 400;
    font-size: 1.5rem;
    line-height: 1.5rem;
    letter-spacing: 5%;
    color: ${ props => props.color };
`
export const Heading2 = styled.h2`
    font-family: 'Heebo',sans-serif;
    font-weight: 400;
    font-size: 20px;
    line-height: 18px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`


export const Heading3 = styled.h2`
    font-family: 'Heebo',sans-serif;
    font-weight: 400;
    font-size: 14px;
    line-height: 18px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const Section1 = styled.p`
    font-family: 'Heebo',sans-serif;
    font-weight: 400;
    font-size: 20px;
    line-height: 24px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const Section2 = styled.p`
    font-family: 'Titillium Web',sans-serif;
    font-weight: 600;
    font-size: 14px;
    line-height: 20px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const Section3 = styled.p`
    font-family: 'Titillium Web',sans-serif;
    font-weight: 600;
    font-size: 12px;
    line-height: 21px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const Section4 = styled.p`
    font-family: 'Titillium Web',sans-serif;
    font-weight: 400;
    font-size: 14px;
    line-height: 20px;
    letter-spacing: 5%;
    text-transform: uppercase;
    color: ${ props => props.color };
`

export const Info1 = styled.p`
    font-family: 'Heebo',sans-serif;
    font-weight: 400;
    font-size: 16px;
    line-height: 24px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const Info2 = styled.p`
    font-family: 'Heebo',sans-serif;
    font-weight: 400;
    font-size: 14px;
    line-height: 18px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const Info3 = styled.p`
    font-family: 'Heebo',sans-serif;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const CTA1 = styled.p`
    font-family: 'Titillium Web',sans-serif;
    font-weight: 600;
    font-size: 14px;
    line-height: auto;
    text-transform: uppercase;
    letter-spacing: 0%;
    color: ${ props => props.color };
`

export const CTA2 = styled.p`
    font-family: 'Titillium Web',sans-serif;
    font-weight: 600;
    font-size: 14px;
    line-height: auto;
    letter-spacing: 0%;
    color: ${ props => props.color };
`

export const CTA3 = styled.p`
    font-family: 'Heebo',sans-serif;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    letter-spacing: 5%;
    color: ${ props => props.color };
`

export const Link = styled.p`
    font-family: 'Titillium Web',sans-serif;
    font-weight: 400;
    font-size: 12px;
    line-height: 21px;
    letter-spacing: 5%;
    text-decoration: underline;
    color: ${ props => props.color };
`
